import React from "react";
import Video from "../components/Video";

const ContentPage = () => {
  return (
    <div className="content-container">
      <Video src="www.youtube.com/watch?v=3P1CnWI62Ik" title="서울" />
      <Video src="www.youtube.com/watch?v=dQ_lCmB2hfk" title="전주" />
      <Video src="www.youtube.com/watch?v=xLD8oWRmlAE" title="부산" />
    </div>
  );
};

export default ContentPage;
